/*
**  "UC San Diego" Chronopolis Dashboard Theme
**  	Files: theme-ucsd.js, theme-ucsd.css
**
**	To activate, call this page from the JS section at the end of "index.jsp".
** 		<script src="js/theme-ucsd.js"></script>
**
**	To deactivate, remove the call to "theme-ucsd.js" from "index.jsp". 
*/

jQuery(document).ready(function($){

	const YEAR = new Date().getFullYear();
	const HEADER_ID = '#cd-header';
	const FOOTER_ID = '#cd-footer';
	const NAV_ID = '#cd-navigation';
	const NAV_BRAND_ID = '#cd-navigation-brand';

	// Add a link to the theme's CSS file
	$('<link/>', {rel: 'stylesheet', type: 'text/css', href: 'css/theme-ucsd.css'}).appendTo('head');

	// Customize the background color of the navbar
	$(NAV_ID).addClass('navbar-dark').removeClass('navbar-light bg-light');
	$(NAV_ID).attr('style', 'background-color: #006a96;');

	// Add Bootstrap display classes to only show the navbar brand in mobile view
	$(NAV_BRAND_ID).addClass('d-block d-sm-none');

	// Add a custom header
	const HEADER_HTML =
			'<section class="layout-title d-none d-sm-block">' +
				'<div class="layout-container container">' +
					'<div class="w-50">' +
						'<a href="#!/home" class="title-header title-header-large">Chronopolis Dashboard</a>' +
					'</div>' +
					'<div class="w-50">' +
						'<a href="https://www.ucsd.edu/" class="title-logo">' +
							'<img alt="UC San Diego" src="data:image/png;base64,">' +
						'</a>' +
					'</div>' +
				'</div>' +
			'</section>';

	$(HEADER_ID).prepend(HEADER_HTML);

	// Add a custom footer
	$(FOOTER_ID).addClass('container-fluid').removeClass('container');

	const FOOTER_HTML =
			'<div class="container">' +
				'<div class="row">' +
					'<div class="col-sm-8 cd-footer-copy">' +
						'<p><span>UC San Diego 9500 Gilman Dr. La Jolla, CA 92093 (858) 534-2230</span></p>' +
						'<p><span>Copyright &copy; <span class="footer-copyright-year">' + YEAR + '</span> Regents of the University of California. All rights reserved.</span></p>' +
						'<ul class="footer-links">' +
							'<li><a href="https://www.ucsd.edu/_about/legal/index.html">Terms &amp; Conditions</a></li>' +
						'</ul>' +
					'</div>' +
					'<div class="col-sm-4 cd-footer-logo">' +
						'<img alt="UC San Diego" class="img-responsive footer-logo" src="data:image/png;base64,">' +
					'</div>' +
				'</div>' +
			'</div>';

	$(FOOTER_ID).append(FOOTER_HTML);

});
